import React, { useState, useEffect } from 'react';
import './Login.css';

function Login() {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [showPassword, setShowPassword] = useState(false);
  const [emailError, setEmailError] = useState('');
  const [passwordError, setPasswordError] = useState('');
  const [mainError, setMainError] = useState('');
  const [isLoading, setIsLoading] = useState(false);

  const togglePasswordVisibility = () => {
    setShowPassword(!showPassword);
  };

  const userLogin = async (event) => {
    event.preventDefault();
    
    // Reset error messages
    setEmailError('');
    setPasswordError('');
    setMainError('');
    
    // Simple validation
    let isValid = true;
    
    if (!email) {
      setEmailError('Email is required');
      isValid = false;
    } else if (!/\S+@\S+\.\S+/.test(email)) {
      setEmailError('Please enter a valid email');
      isValid = false;
    }
    
    if (!password) {
      setPasswordError('Password is required');
      isValid = false;
    }
    
    if (isValid) {
      setIsLoading(true);
      
      try {
        // Replace with your actual login API call
        const response = await fetch('/login', {
          method: 'POST',
          headers: {
            'Content-Type': 'application/json',
          },
          body: JSON.stringify({ email, password }),
        });
        
        if (response.ok) {
          window.location.href = '/dashboard'; // Redirect to dashboard on success
        } else {
          const data = await response.json();
          setMainError(data.message || 'Login failed');
        }
      } catch (error) {
        setMainError('An error occurred. Please try again later.');
      } finally {
        setIsLoading(false);
      }
    }
  };

  return (
    <div className="login-container">
      <div className="login-header">
        <h2>Welcome Back</h2>
      </div>

      {/* Main Error Message */}
      {mainError && <div id="mainError" className="main-error" style={{ display: 'block' }}>{mainError}</div>}

      {/* Loader */}
      {isLoading && (
        <div id="loader" className="loader-container" style={{ display: 'flex' }}>
          <div className="spinner"></div>
        </div>
      )}

      <form id="loginform" onSubmit={userLogin}>
        <div className="form-group">
          <label htmlFor="email">Email</label>
          <input 
            type="email" 
            id="email" 
            name="email" 
            placeholder="Enter email" 
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            required 
          />
          {emailError && <div id="error1" className="error-message">{emailError}</div>}
        </div>

        <div className="form-group">
          <label htmlFor="password">Password</label>
          <input 
            type={showPassword ? "text" : "password"} 
            id="password" 
            name="password" 
            placeholder="Enter password" 
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            required 
          />
          <div className="password-icon" onClick={togglePasswordVisibility}>
            <i className={`fas ${showPassword ? "fa-eye-slash" : "fa-eye"}`}></i>
          </div>
          {passwordError && <div id="error2" className="error-message">{passwordError}</div>}
        </div>

        <div className="forgot-password">
          <a href="/forgot-password">Forgot Password?</a>
        </div>

        <button type="submit" className="login-btn">Login</button>
      </form>

      <div className="or-continue">or continue with</div>
      <a href="/auth/google" className="google-btn">
        <i className="fab fa-google"></i> Login with Google
      </a>

      <div className="signup-link">
        Don't have an account? <a href="/signup">Sign Up</a>
      </div>
    </div>
  );
}

export default Login;
